ared was all \u201Cstuff.\u201D \u201CIntroduce me, now there\u2019s a good fellow,\u201D he said, \u201CIf we happen to meet it together!\u201D And the Bellman, sagaciously nodding his head, Said \u201CThat must depend on the weather.\u201D The Beaver went simply galumphing about, At seeing the Butcher so shy: And even the Baker, though stupid and stout, Made an effort to wink with one eye. \u201CBe a man!\u201D said the Bellman in wrath, as he heard The Butcher beginning to sob. \u201CShould we meet with a Jubjub, that desperate bird, We shall need all our strength for the job!\u201D');DB((LD[b]=HT+XF,this.a));Ds((LD[b]=HT+FI,this.b),this.a);KD=b-1};Bo(295,1,{},uC);_.Rb=function vC(){var a;JD[a=++KD]=vC;JB((LD[a]=HT+SF,this.a));KD=a-1};Bo(297,1,{},xC);_.Sb=function yC(a){var b;JD[b=++KD]=yC;vs((LD[b]=IT+GF,this.b));MC((LD[b]=IT+VF,this.a),new AC(a));KC((LD[b]=IT+NE,this.a),JT);OC((LD[b]=IT+eF,this.a),'It strongly advised that the Butcher should be Conveyed in a separate ship: But the Bellman declared that would never agree With the plans he had made for the trip: Navigation was always a difficult art, Though with only one ship and one bell: And he feared he must really decline, for his part, Undertaking another as well. The Beaver\u2019s best course was, no doubt, to procure A second-hand dagger-proof coat-- So the Baker advised it--and next, to insure Its life in some Office of note: This the Banker suggested, and offered for hire (On moderate terms), or for sale, Two excellent Policies, one Against Fire, And one Against Damage From Hail. Yet still, ever after that sorrowful day, Whenever the Butcher was by, The Beaver kept looking the opposite way, And appeared unaccountably shy.');DB((LD[b]=IT+fI,this.a));Ds((LD[b]=IT+jF,this.b),this.a);KD=b-1};Bo(298,1,{},AC);_.Rb=function BC(){var a;JD[a=++KD]=BC;JB((LD[a]=IT+eI,this.a));KD=a-1};Bo(299,1,{},DC);_.Sb=function EC(a){var b,c;JD[c=++KD]=EC;vs((LD[c]=KT+rL,this.b));b=new (LD[c]=KT+WF,SC);MC((LD[c]=KT+eI,b),new GC(
